  input: 'TEXT,F3XA,,"This responds to the Commissions letter of February 16, 2007:    1)    This
    contribution was apparently inadvertently misdeposited into the federal account
    and was refunded to the donor on March 8, 2007    2)  The Committee was designated
    by the Democratic Congressional Campaign Committee to make coordinated expenditures
    for all of its authority, the report has been amended to indicate this.  The Indiana
    Democratic Party had all 441a(d) authority for the Donnelley election (IN-2)  3)    Expenditures
    to Groundswell communications were for voter id calls all other expenditures for  advertisement,
    direct mail, media buy and postage did not reference any federal candidate  4)  Expenditures
    on Line 21b for advertisement, postage and postage reply did not reference any
    federal candidate nor did the communications constitute a federal election activity   5)     The
    committee properly reported payroll and benefit expenses on Line 21a for employees
    who did not work more than 25% of their time in connection with federal elections   6)       Expenditures
    for voter file maintenance are not for activities that meet the definition of
    federal election activity.   7)  Report has been amended to provide more specific
    descriptions    8)   Expenditures for equipment lease were for ordinary office
    expenses and not on behalf of any candidate   9)"'
